export default function List ({data}) {

  data = [1,2,3]
  let a = [1,2,3]
  return (
    <ul>
      {
        a.map((x,i)=>{
          <li key={i}>{x}</li>
        })
      }
      <li>{data[0]}</li>
    </ul>
  );
}
